Boba tea by @justs0meartist

"Here’s my Lychee and White Peach Boba Tea inspired look! This drink is as pretty as it is delicious. It starts off a separation of purple and clear but once you shake it it turns a gorgeous reddish pink, so I really wanted to capture that full colour gradient, as if you let it mix gradually you see yellows and oranges and pinks mixing in. I painted little ice cubes at the top and stars on my cheeks for the toppings and then brought the gradient down from my forehead to my cheeks. I left the bottom portion clear and did a nude lip because I wanted it to be like the drink was partially mixed, so it still has that clear bottom layer, but that beautiful gradient as you move up. I put the stars on my cheeks though as I wasn’t really feeling a starry beard 😆 unfortunately it was no longer available when I did the makeup so I tried to photoshop some water to look like it but,, I’ll let y’all decide if that was a good idea or not 😅"

