To able to deliver the best bubble tea to you, An‘s Tea House use only ingredients of the best quality, because we value the experience of our customers. The freshness of the fruits and the aroma of fresh milk are things that can never be faked💪🏻💪🏻💪🏻. However, that alone is not enough to make things tasty. We also pay attention to every details, such as the texture of the bobas, the temperature of the tea, the ratio of the elements in every mixture. We work hard and always give our best to achieve the perfection of the end-product. 
We trust that every ounce of our effort will put a smile on your face in the end.😊❤️❤️❤️❤️❤️❤️❤️❤️❤️❤️❤️❤️❤️❤️
